import styles from './Navigation.module.css'
import {Card} from 'react-bootstrap'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const Cart = () => {
    return(
        <Card>
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ffindicons.com%2Fsearch%2Fcart&psig=AOvVaw1yL5kOiIoofzP-CQCQOV8K&ust=1631780755768000&source=images&cd=vfe&ved=0CAkQjRxqFwoTCPC2p5THgPMCFQAAAAAdAAAAABAD" alt="Italian Trulli"/>
            <div className={styles.cart}>Your Cart</div>
        </Card>
    )
}

export default Cart;
